import React from 'react';
// import logo from './logo.svg';
import './MainContainer.css';


const user = {
  firstName: 'H',
  lastName: 'p'
}

function mainContainer(user) {
  return user.firstName + ' ' + user.lastName;
}

const el = (
  <h1>
  Hello, {mainContainer(user)}!
  </h1>
)

function render() { 
  return el;
}

export default render;
